import React from 'react';
import './gameBoard.css'



class Table extends React.Component{
    render(){
        return (
            <table>
                <tr>
                    <td><img src={require(`${this.props.image}`)} className ="cell"/> </td>
                    <td><img src={require(`${this.props.image}`)}/> </td>
                </tr>
                <tr>
                    <td><img src={require(`${this.props.image}`)}/> </td>
                    <td><img src={require(`${this.props.image}`)}/> </td>
                </tr>
            </table>
        )
    }
}


class Game extends React.Component{
    render(){
        return (
            <Table image = {"./imagies/joker-white.jpg"}/>

        )
    }
}

export default Game;
